    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> ans = new ArrayList<Integer>();
        if(p.length()>s.length()) return ans;
        HashMap<Character,Integer> pm = new HashMap<>();
        HashMap<Character,Integer> sm = new HashMap<>();
        for(char c : p.toCharArray()){
            pm.put(c,pm.getOrDefault(c,0)+1);
        }
        int pLen = p.length()-1;

        for(int i=0;i<s.length();i++){
            sm.put(s.charAt(i),sm.getOrDefault(s.charAt(i),0)+1);
            if(i>=p.length()-1){
                if(pm.keySet().equals(sm.keySet())){
                    boolean flag =true;
                    for(Character c : pm.keySet()){
                        if(pm.get(c).intValue()!=sm.get(c).intValue()) {
                            flag=false;
                            break;
                        };
                    }
                    if(flag)
                        ans.add(i-pLen);
                }
                sm.put(s.charAt(i-pLen),sm.get(s.charAt(i-pLen))-1);
                if(sm.get(s.charAt(i-pLen))==0){
                    sm.remove(s.charAt(i-pLen));
                }

            }
        }
        return ans;

    }
    public static int[] pivotArray(int[] nums, int pivot) {
        int ans[] = new int[nums.length];
        int i=0;
        int x=0;
        int y=nums.length-1;
        while(i<nums.length){
            if(nums[i]<pivot){
                ans[x++]=nums[i];
            }
            i++;
        }
        int j= nums.length-1;
        while(j>=0){
            if(nums[j]>pivot){
                ans[y--]=nums[j];
            }
            j--;
        }
        for(;x<=y;x++){
            ans[x]=pivot;
        }
        return ans;
    }

    public static long minimumDifference(int[] nums) {
        long sum[]=new long[nums.length+1];
        int n= nums.length/3;
        sum[0]=0;
        for(int i=0;i<nums.length;i++){
            sum[i+1]=sum[i]+nums[i];
        }
        long min =Long.MAX_VALUE;
        for (int i=0;i<sum.length-n-1;i++){
            long x = sum[i+2*n]-(sum[i+n]-sum[i]);
            min=Long.min(min,x);
        }
        //sum[n]-sum[0]-(sum[n]+sum[n+1]);
        System.out.println(min);
        return min;
    }

    public static int[] sortEvenOdd(int[] nums) {
        int num0[];
        int num1[];
        int n = nums.length;
        if(n%2==0){
            num0=new int[n/2];
            num1=new int[n/2];
        }else{
            num0=new int[n/2+1];
            num1=new int[n/2];
        }
        int x=0;int y=0;
        for(int i=0; i<n;i++){
            if(i%2==0) num0[x++]=nums[i];
            else num1[y++]=nums[i];
        }

        Arrays.sort(num0);
        Arrays.sort(num1);

        x=0;
        int i=0;
        while( i<n){
            if(x<num0.length) nums[i++]=num0[x++];
            if(y>=1) nums[i++]=num1[--y];
        }
        return nums;
    }

    public static long smallestNumber(long num) {
        if(num==0) return 0;
        long x = num;
        if(x<0) x=x*-1;
        List<Long> aList = new ArrayList<>();

        while (x!=0){
            aList.add(x%10);
            x/=10;
        }

        long sum=0;
        if(num<0){
            Collections.sort(aList,Collections.reverseOrder());
            for(long i : aList){
                sum=sum*10+i;
            }
            System.out.println(-sum);
            return -sum;
        }else{
            Collections.sort(aList);
            if(aList.get(0)==0){
                for(int i=0; i<aList.size();i++){
                    if(aList.get(i)==0) continue;
                    else {
                        aList.set(0,aList.get(i));
                        aList.set(i,0L);
                        break;
                    }

                }
            }

            for(long j : aList){
                sum=sum*10+j;
            }
            System.out.println(sum);
            return sum;
        }


    }
